// import Logo from './icons/zeit-white-full-logo';

import Headings from "./designLayouts/headings";

const Banner = () => {
  return (
    <div className="banner">
    <div>
        <picture class="Picture__PictureContainer-ktdqlh-1 gBrrSa">
          <source srcset="https://www.trulia.com/javascript/moana//_next/static/assets/hiDpiExtraLarge-e37629506abe8e78ca2e714188ec2d87.webp" type="image/webp" media="(min-width:993px) and (min-resolution:124dpi), (min-width:993px) and (-webkit-min-device-pixel-ratio: 2)"/>
          <source srcset="https://www.trulia.com/javascript/moana//_next/static/assets/hiDpiExtraLarge-e3d56c6337c994b49d5b40cdc7df5bd7.jpg" media="(min-width:993px) and (min-resolution:124dpi), (min-width:993px) and (-webkit-min-device-pixel-ratio: 2)"/>
        </picture>
    </div>
      <div className="inner">
        <Headings
          Tag="h1"
          text="Discover a place you'll love to live"
          classNme="banner-heading"
        />

        <a
          href="https://zeit.co/import?filter=next.js&utm_source=next-site&utm_medium=banner&utm_campaign=next-website"
          target="_blank"
          rel="noopener noreferrer"
        >
          <p>
            Deploy <b>Next.js</b> on the platform it was made for →
          </p>

          <p className="mobile">
            Deploy <b>Next.js</b> in seconds →
          </p>
        </a>
      </div>

      <style jsx>{`
        .banner {
          width: 100%;
          background-image: "https://www.trulia.com/javascript/moana//_next/static/assets/hiDpiExtraLarge-e3d56c6337c994b49d5b40cdc7df5bd7.jpg";
          color: #fff;
          height: 50px;
          display: flex;
          align-items: center;
        }
        .banner-heading{
          text-align: center;
          justify-content: center;
        }
        .inner {
          width: 100%;
          max-width: 1024px;
          margin: 0 auto;
          padding: 0 1rem;
          display: flex;
          align-items: center;
          justify-content: space-between;
        }
        a {
          display: inline-flex;
        }
        p {
          color: #fff;
          margin: 0;
          transition: color 0.15s ease;
        }
        .mobile {
          display: none;
        }
        @media (max-width: 640px) {
          p {
            font-size: 14px;
          }
          p {
            display: none;
          }
          .mobile {
            display: block;
          }
        }
      `}</style>
    </div>
  );
};

export default Banner;
